import React from "react";
import { Github, Linkedin, Twitter, Mail, ExternalLink, ShieldCheck, Heart } from "lucide-react";
import { motion } from "framer-motion";

const Footer: React.FC = () => {
  const year = new Date().getFullYear();

  const socialLinks = [
    { icon: Github, url: "https://github.com/", label: "GitHub", color: "hover:bg-slate-800" },
    { icon: Linkedin, url: "https://linkedin.com/", label: "LinkedIn", color: "hover:bg-blue-600" },
    { icon: Twitter, url: "https://twitter.com/", label: "Twitter", color: "hover:bg-sky-500" },
    { icon: Mail, url: "mailto:info@collabryta.com", label: "Email", color: "hover:bg-rose-500" },
  ];

  const sections = [
    {
      title: "Product",
      links: [
        { name: "Features", url: "/features" },
        { name: "Integrations", url: "#" },
        { name: "Pricing", url: "#" },
        { name: "Changelog", url: "#" },
      ],
    },
    {
      title: "Company",
      links: [
        { name: "About Us", url: "/about" },
        { name: "Careers", url: "#" },
        { name: "Blog", url: "#" },
        { name: "Contact", url: "/support" },
      ],
    },
    {
      title: "Resources",
      links: [
        { name: "Documentation", url: "/docs" },
        { name: "Help Center", url: "/support" },
        { name: "Community", url: "#" },
        { name: "Privacy Policy", url: "#" },
      ],
    },
  ];

  return (
    <footer className="w-full bg-[#030712] border-t border-slate-900 pt-20 pb-10 px-4 sm:px-10 overflow-hidden relative">
      {/* ðŸŒŒ Background Decor */}
      <div className="absolute top-0 right-0 w-[40%] h-[40%] bg-blue-900/10 blur-[100px] rounded-full" />
      <div className="absolute bottom-0 left-0 w-[30%] h-[30%] bg-indigo-900/5 blur-[80px] rounded-full" />

      <div className="max-w-7xl mx-auto relative z-10">
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-5 gap-16 mb-20">
          {/* Logo & Brand Info */}
          <div className="lg:col-span-2 space-y-8">
            <div className="flex items-center gap-4 group cursor-pointer">
              <div className="p-3 bg-gradient-to-br from-blue-600 to-indigo-700 rounded-2xl shadow-xl shadow-blue-900/40 transition-transform group-hover:scale-110">
                <img src="/logo1.png" alt="Logo" className="w-8 h-8 invert brightness-110" />
              </div>
              <div>
                <h2 className="text-3xl font-black tracking-tighter text-white">Collabryta</h2>
                <div className="h-1 w-8 bg-blue-500 rounded-full mt-1" />
              </div>
            </div>
            <p className="text-slate-500 text-sm leading-relaxed max-w-sm">
              The neural center for modern engineering teams. Experience the next generation of project management with AI-integrated workflows and real-time collaboration.
            </p>
            <div className="flex items-center gap-4">
              {socialLinks.map(({ icon: Icon, url, label, color }) => (
                <motion.a
                  key={label}
                  href={url}
                  target="_blank"
                  rel="noopener noreferrer"
                  whileHover={{ y: -6, scale: 1.1 }}
                  className={`p-3 rounded-2xl border border-slate-800/80 text-slate-500 hover:text-white ${color} transition-all duration-300 shadow-xl bg-slate-900/50`}
                >
                  <Icon size={20} />
                </motion.a>
              ))}
            </div>
          </div>

          {/* Nav Sections */}
          {sections.map((section) => (
            <div key={section.title} className="space-y-8">
              <h3 className="text-xs font-black uppercase tracking-[0.25em] text-slate-400">{section.title}</h3>
              <ul className="space-y-5">
                {section.links.map((link) => (
                  <li key={link.name}>
                    <a
                      href={link.url}
                      className="text-slate-500 text-sm font-medium hover:text-blue-400 hover:translate-x-2 inline-block transition-all"
                    >
                      {link.name}
                    </a>
                  </li>
                ))}
              </ul>
            </div>
          ))}
        </div>

        {/* Bottom Line */}
        <div className="pt-10 border-t border-slate-900/80 flex flex-col md:flex-row justify-between items-center gap-8">
          <div className="flex items-center gap-3 text-slate-500 text-xs font-bold uppercase tracking-widest">
            <div className="p-1.5 bg-emerald-500/10 rounded-lg">
              <ShieldCheck size={14} className="text-emerald-500" />
            </div>
            <span>Enterprise Grade Security</span>
          </div>

          <p className="text-slate-600 text-xs font-medium">
            Â© {year} <span className="text-white font-bold">COLLABRYTA SYSTEM</span> v2.4.0. All sectors operational.
          </p>

          <div className="flex items-center gap-2 text-xs text-slate-500 font-bold uppercase tracking-widest">
            <span>Core Built with</span>
            <motion.div animate={{ scale: [1, 1.2, 1] }} transition={{ repeat: Infinity, duration: 2 }}>
              <Heart size={14} className="text-rose-600 fill-rose-600" />
            </motion.div>
            <span>by Humans</span>
          </div>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
